import React from "react";
import {
Heading,
Container,
Row,
Column,
} from "./styles/FooterStyles";

const sampleData = [
    {
      name: "Facebook",
      url: "#",
      icons: "https://img.icons8.com/material-rounded/48/ffffff/facebook.png",
    },
    {
      name: "LinkedIn",
      url: "#",
      icons: "https://img.icons8.com/material-rounded/48/ffffff/linkedin--v1.png",
    },
    {
      name: "Instagram",
      url: "#",
      icons:
        "https://img.icons8.com/material-rounded/48/ffffff/instagram-new.png",
    },
  ];

const Footer = () => {
return (
    <Container>
	<Row>

		<Column>
			<Heading>About us</Heading>
			<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. It was popularised in the 1960s with the release of Letraset Lorem Ipsum.</p>
		</Column>

		<Column>
            <Heading>Contact us</Heading>
			<h2 style={{fontSize:"1rem"}}>Address:</h2>
            <p>8th Floor, Global Infocity Park, #40, Dr, MGR Main Rd, Perungudi, Chennai, Tamil Nadu 600096</p>
            <p>Phone: 044 4599 2000</p>
		</Column>
        <Column>
            <Heading>Social media</Heading>
            <h2>Follow us on</h2>
            <div id="social-media">{sampleData.map((data) => (<a href={data.url}><img className="social-media-logo" src={data.icons} title={data.name}></img>
            </a>
          ))}
        </div>
        </Column>
	</Row>
    </Container>
);
};
export default Footer;
